import React from 'react'
import {BrowserRouter,Routes,Route} from "react-router-dom";
import Accueil from './pages/Accueil';

export default function App() {



  return (
    <div>
        <BrowserRouter>
            <Routes>
                <Route path="/accueil" element={<Accueil/>} />
            </Routes>
        </BrowserRouter>
    </div>
  )
}
